pragma solidity 0.5.12;
import "./PrivateCompany.sol";
import "./IPrivateCompanyFactory.sol";

contract PrivateCompanyFactory is IPrivateCompanyFactory {event __CoveragePrivateCompanyFactory(string fileName, uint256 lineNumber);
event __FunctionCoveragePrivateCompanyFactory(string fileName, uint256 fnId);
event __StatementCoveragePrivateCompanyFactory(string fileName, uint256 statementId);
event __BranchCoveragePrivateCompanyFactory(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoveragePrivateCompanyFactory(string fileName, uint256 branchId);
event __AssertPostCoveragePrivateCompanyFactory(string fileName, uint256 branchId);


    function newCompany(
        address intendedOwner,
        string memory name,
        string memory symbol
    )
    public returns (address) {emit __FunctionCoveragePrivateCompanyFactory('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompanyFactory.sol',1);

emit __CoveragePrivateCompanyFactory('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompanyFactory.sol',13);
        emit __StatementCoveragePrivateCompanyFactory('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompanyFactory.sol',1);
PrivateCompany c = new PrivateCompany(intendedOwner, name, symbol);
emit __CoveragePrivateCompanyFactory('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompanyFactory.sol',14);
        emit __StatementCoveragePrivateCompanyFactory('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompanyFactory.sol',2);
emit newCompanyCreated(intendedOwner, address(c));
emit __CoveragePrivateCompanyFactory('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompanyFactory.sol',15);
        emit __StatementCoveragePrivateCompanyFactory('/home/shuloh/Code/entangle-exchange/contracts/PrivateCompanyFactory.sol',3);
return address(c);
    }
}
